{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyPsbGq6+jACzEmY8GkFhtoG"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"code","execution_count":null,"metadata":{"id":"uFENn3H97n1L"},"outputs":[],"source":["# import libraries\n","import numpy as np\n","import pandas as pd\n","import matplotlib.pyplot as plt\n","import tensorflow as tf\n","from keras.utils.np_utils import to_categorical\n","from sklearn.model_selection import train_test_split\n","from sklearn.preprocessing import MinMaxScaler"]},{"cell_type":"code","source":["# download the mnist dataset in csv format\n","!wget 'https://pkgstore.datahub.io/machine-learning/mnist_784/mnist_784_csv/data/89c44af4c515d5a3c132bc3cc298a6bd/mnist_784_csv.csv'\n","\n","# read the csv file into a pandas dataframe\n","data = pd.read_csv('/content/mnist_784_csv.csv',sep=',')"],"metadata":{"id":"MKBulREE7_Lj"},"execution_count":null,"outputs":[]},{"cell_type":"code","source":["# print the rows\n","\n","# each row consists of a 28x28 image flattened as a 784 vector followed by the class of that image\n","# so first 784 columns of each row is an image and the 785th column is the corresponding class\n","data.head()"],"metadata":{"id":"0J1mB2od9BtW"},"execution_count":null,"outputs":[]},{"cell_type":"code","source":["# visualize an image\n","idx = 15 # choose a random index\n","img = data.iloc[idx,:-1].to_numpy() # fetch the flattened image\n","label = data.iloc[idx,-1] # fetch the corresponding label\n","img = np.reshape(img,(28,28)) # reshape image to 28x28\n","print('label is : '+str(label))\n","plt.imshow(img,cmap='gray')\n","plt.show()\n"],"metadata":{"id":"IQQda6u89Ohi"},"execution_count":null,"outputs":[]},{"cell_type":"code","source":["# find counts of each class in the dataset\n","# you can see that the class distribution is almost balanced\n","print(data['class'].value_counts())"],"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"k3npTSQu-MAj","executionInfo":{"status":"ok","timestamp":1684352631935,"user_tz":-330,"elapsed":755,"user":{"displayName":"Pijush Bhuyan","userId":"04528471696330882279"}},"outputId":"c64536a9-ab83-44bc-f85f-fbf778778046"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["1    7877\n","7    7293\n","3    7141\n","2    6990\n","9    6958\n","0    6903\n","6    6876\n","8    6825\n","4    6824\n","5    6313\n","Name: class, dtype: int64\n"]}]},{"cell_type":"code","source":["#feature scaling - normalize each input image\n","scaler = MinMaxScaler()\n","X = data.iloc[:,:-1].to_numpy()\n","X = scaler.fit_transform(X) # convert pixel values to range [0,1]\n","\n","# one hot encode the labels\n","y =  data.iloc[:,-1].to_numpy()\n","y = to_categorical(y, num_classes=10)\n","print('Shape of X : '+str(X.shape))\n","print('Shape of y : '+str(y.shape))"],"metadata":{"id":"X3KDlJL8Eb88"},"execution_count":null,"outputs":[]},{"cell_type":"code","source":["# split the data into training and testing sets\n","X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.30, random_state=42) # split with test size 30%\n","print('Shape of X_train : '+str(X_train.shape))\n","print('Shape of X_test : '+str(X_test.shape))\n","print('Shape of y_train : '+str(y_train.shape))\n","print('Shape of y_test : '+str(y_test.shape))"],"metadata":{"id":"UzsQewmq_SN1"},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":["![image.png](data:image/png;base64,)"],"metadata":{"id":"Fo-jr5Clv6cr"}},{"cell_type":"code","source":["# build a 2 layer neural network classifier\n","model = tf.keras.models.Sequential([\n","  tf.keras.layers.Input(shape=(784,)), # input layer has shape equal to input data\n","  tf.keras.layers.Dense(units = 128, activation='relu',kernel_initializer='uniform'), # intermediate layer contains 128 neurons\n","  tf.keras.layers.Dense(units = 10, activation='softmax',kernel_initializer='uniform') # last layer contains 10 neurons which is equal to number of target classes\n","])\n","\n","model.summary()"],"metadata":{"id":"h6zSI7TjALWm"},"execution_count":null,"outputs":[]},{"cell_type":"code","source":["# set the loss function , optimizer and evaluatoion metric\n","model.compile(\n","    optimizer='adam',\n","    loss='categorical_crossentropy',\n","    metrics=['accuracy'],\n",")"],"metadata":{"id":"JddM9WaZANAt"},"execution_count":null,"outputs":[]},{"cell_type":"code","source":["# train the model for 5 epochs \n","history = model.fit(\n","  X_train,\n","  y_train,\n","  epochs=5,\n","  verbose=True,\n","  batch_size=32,\n","  validation_split=0.2\n",")"],"metadata":{"id":"JhNyVgyWBWjH"},"execution_count":null,"outputs":[]},{"cell_type":"code","source":["# plot the loss and accuracy vs epochs \n","\n","acc = history.history['accuracy']\n","val_acc = history.history['val_accuracy']\n","loss = history.history['loss']\n","val_loss = history.history['val_loss']\n","\n","\n","plt.figure(figsize=(8,3))\n","epochs = range(1, len(acc) + 1)\n","plt.subplot(1,2,1)\n","plt.plot(epochs, acc, 'b', label='Training acc')\n","plt.plot(epochs, val_acc, 'r', label='Validation acc')\n","plt.title('Training and validation accuracy')\n","plt.legend()\n","\n","\n","plt.subplot(1,2,2)\n","plt.plot(epochs, loss, 'b', label='Training loss')\n","plt.plot(epochs, val_loss, 'r', label='Validation loss')\n","plt.title('Training and validation loss')\n","plt.legend()\n","\n","plt.show()"],"metadata":{"id":"Y1cLzlqSNMC4"},"execution_count":null,"outputs":[]},{"cell_type":"code","source":["# find evaluation accuracy on unseen test set\n","res = model.evaluate(X_test,y_test)\n","print('Accuracy on test set : '+str(res[1]))"],"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"QrnzeXpUCyrQ","executionInfo":{"status":"ok","timestamp":1684353268807,"user_tz":-330,"elapsed":1680,"user":{"displayName":"Pijush Bhuyan","userId":"04528471696330882279"}},"outputId":"fa99dac3-5dcf-4c58-9e34-e97b43b1179c"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["657/657 [==============================] - 2s 2ms/step - loss: 0.1035 - accuracy: 0.9697\n","Accuracy on test set : 0.9696666598320007\n"]}]},{"cell_type":"code","source":["# calculate preditions on test set\n","pred = model.predict(X_test)"],"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"czQHVOusIaO4","executionInfo":{"status":"ok","timestamp":1684353295592,"user_tz":-330,"elapsed":1727,"user":{"displayName":"Pijush Bhuyan","userId":"04528471696330882279"}},"outputId":"df93c66f-f986-41c0-b752-ec24a59b6000"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["657/657 [==============================] - 1s 2ms/step\n"]}]},{"cell_type":"code","source":["# visualize prediction on test set\n","idx = 56 # enter a random index here\n","\n","img = np.reshape(X_test[idx],(28,28))\n","predicted_label = np.argmax(pred[idx])\n","actual_label = np.argmax(y_test[idx])\n","plt.imshow(img,cmap='gray')\n","plt.show()\n","print('Actual label : '+str(actual_label))\n","print('Predicted label : '+str(predicted_label))"],"metadata":{"id":"CNEISJBBIsPF"},"execution_count":null,"outputs":[]}]}